const LoginForm = ({ handleSubmit, username, password }) => {
  return (
    <div>
      <h2>Login</h2>

      <form onSubmit={handleSubmit}>
        <div>
          username
          <input value={username} />
        </div>
        <div>
          password
          <input type="password" value={password} />
        </div>
        <button type="submit">login</button>
      </form>
    </div>
  );
};

export default LoginForm;
